import React, { useEffect, useState } from 'react';
import { useParams } from "react-router-dom";

export const VehicleId = () => {
    console.log(useParams())
    const { vehicleid } = useParams();
    var make,model,year,odometer,service_history;

    useEffect(() => {
        let ignore = false;

        async function startFetching() {

            const data = {
                vehicle_id: vehicleid 
            };
            const headers = {
                'Content-Type': 'application/json',
                'Access-Control-Allow-Origin':'*',
                'Access-Control-Allow-Methods':'GET'
            };
            fetch("http://localhost:5000/get_vehicle", {
                method: 'GET',
                headers: headers
            })
            .then((response)=>{
                response.json().then(function(result){
                    if (!ignore) {
                        console.log(result["vehicles"]);
                    }
                })
            })
            .catch((error) => {
                console.error('Error:', error);
            });
        }

        startFetching();

        return () => {
            ignore = true;
        };
      },[]);

    return (
        <div id="root">
            <h1>Vehicle Information</h1>
            <p><strong>Make:</strong> Toyota</p>
            <p><strong>Model:</strong> Corolla</p>
            <p><strong>Year:</strong> 2020</p>
            <p><strong>Odometer Reading:</strong> 45,000 miles</p>
            <span><button id="updateHistoryBtn">Update Service History</button><button id="NotifBtn">Send Service Reminder</button></span>

            <div id="serviceHistoryModal" style={{display: "none"}}>
            <h2>Update Service History</h2>
            <textarea id="historyInput" rows="5" cols="50"></textarea>
            <button id="saveHistoryBtn">Save</button>
            <button id="cancelHistoryBtn">Cancel</button>
            </div>

            <h2>Service History & Notes</h2>
            <textarea id="service_history" name="service_history" rows="4" cols="50">Your Mother</textarea>
        </div>
    );
}
